  `table_type` tinyint(2) unsigned DEFAULT NULL COMMENT '桌台类型：1 普通台、2 包台',
  `parent_id` bigint(20) NOT NULL COMMENT '上级ID',
  `user_parent_path` varchar(200) NOT NULL COMMENT '用户上级路径',
  `bet_ip` char(15) DEFAULT NULL COMMENT '用户下注IP',
  `device_type` tinyint(2) unsigned DEFAULT NULL COMMENT '下注设备类型：1 WEB  2 IOS  3 ANDROID',
  `device_info` varchar(300) DEFAULT NULL COMMENT '设备信息',
  `modified_user_balance` decimal(20,2) DEFAULT NULL COMMENT '用户点数调整后余额',
