-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` bigint(30) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `login_name` varchar(300) CHARACTER SET utf8 NOT NULL COMMENT '登录名',
  `nick_name` varchar(300) CHARACTER SET utf8 DEFAULT NULL COMMENT '昵称',
  `password` varchar(80) CHARACTER SET utf8 NOT NULL COMMENT '登录密码',
  `phone` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '电话',
  `email` varchar(30) COLLATE utf8_bin DEFAULT NULL COMMENT '电邮',
  `balance` decimal(30,2) DEFAULT '0.00' COMMENT '账户余额',
  `barrcode` varchar(60) CHARACTER SET utf8 DEFAULT NULL COMMENT '条形码，所有人有权限都可以条形码登录',
  `head_pic` varchar(300) CHARACTER SET utf8 DEFAULT NULL,
