-- ----------------------------
-- View structure for liveuserview
-- ----------------------------
DROP VIEW IF EXISTS `liveuserview`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `liveuserview` AS (select `u`.`id` AS `id`,`u`.`login_name` AS `login_name`,`u`.`nick_name` AS `nick_name`,`u`.`password` AS `password`,`u`.`phone` AS `phone`,`u`.`email` AS `email`,`u`.`balance` AS `balance`,`u`.`barrcode` AS `barrcode`,`u`.`head_pic` AS `head_pic`,`u`.`user_type` AS `user_type`,`u`.`user_status` AS `user_status`,`u`.`password_salt` AS `password_salt`,`u`.`create_time` AS `create_time`,`u`.`create_by` AS `create_by`,`lu`.`user_id` AS `user_id`,`lu`.`is_bet` AS `is_bet`,`lu`.`source` AS `source`,`lu`.`type` AS `type`,`lu`.`parent_id` AS `parent_id`,`lu`.`parent_path` AS `parent_path`,`lu`.`wash_percentage` AS `wash_percentage`,`lu`.`into_percentage` AS `into_percentage`,`lu`.`win_money` AS `win_money`,`lu`.`biggest_win_money` AS `biggest_win_money`,`lu`.`chips` AS `chips` from (`user` `u` join `live_user` `lu` on((`u`.`id` = `lu`.`user_id`)))) ;

-- ----------------------------
-- Procedure structure for test_proc
-- ----------------------------
DROP PROCEDURE IF EXISTS `test_proc`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `test_proc`()
BEGIN
  declare my_sn varchar(30);
DECLARE done INT DEFAULT FALSE;
  DECLARE cur CURSOR FOR 
   
  select `sn` from account_record where `sn` is NOT null GROUP BY `sn` HAVING count(1)>1;
  
  
 DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

 
  OPEN cur;
  
  read_loop: LOOP

    FETCH cur INTO my_sn;

    IF done THEN
      LEAVE read_loop;
    END IF;

		UPDATE account_record set `sn`=CONCAT(sn,(CEIL(RAND() * 51) + 99)) where `sn` =my_sn;
		
		COMMIT;
  END LOOP;

  CLOSE cur;
END
;;
DELIMITER ;
